import React, { Component } from 'react';

class App extends Component {
    // this problem solut
    constructor(props){
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(){
        console.log('Button Clicked',this);
    }
    render() { 
        return ( 
            <>
                <button onClick={this.handleClick}>Click Me</button>          
            </>
         );
    }
}
 
export default App;
